import logo from './logo.svg';
import './App.css';

const initState = {
  books: [
    {
      id: 1,
      title: "مقدمة ابن خلدون ",
      author: "ابن خلدون ",
      isbn: "1289499030"
    },
    {
      id: 2,
      title: "الحاوي في الطب ",
      author: "ابو بكر الرازي ",
      isbn: "893847239479"
    }
  ]


}
export default function Profile() {
  return (
    <>
      <h1>{initState.books[0].id}</h1>

    </>
  );
}

